import React, { useState, useEffect} from "react";
import { useTranslation, withTranslation } from "react-i18next";
import '../../i18n.js'
import i18n from 'i18next'

function headerComponent(props){
//    const { t, i18n } = useTranslation();

   return (<thead className="header">
                               <button onClick={() => changeLanguage("en", i18n)}>EN</button>
                <button onClick={() => changeLanguage("sk", i18n)}>SK</button>   
                <button onClick={() => changeLanguage("de", i18n)}>DE</button>   
   <tr>
       <th onClick={() =>props.refreshWeathers("_id", props.weathers) }>{"cityId"}</th>
       <th onClick={() =>props.refreshWeathers("name", props.weathers) }>{ i18n.t('header.cityName')}</th>
       <th onClick={() =>props.refreshWeathers("coord.lat", props.weathers) }>{"latitude"}</th>
       <th onClick={() =>props.refreshWeathers("coord.lon", props.weathers) }>{"longitude"}</th>
       <th onClick={() =>props.refreshWeathers("sys.country", props.weathers) }>{"country"}</th>
       <th onClick={() =>props.refreshWeathers("weatherMain.humidity", props.weathers) }>{"humidity"}</th>
       <th onClick={() =>props.refreshWeathers("weatherMain.feels_like", props.weathers) }>{"feels like"}</th>
       <th onClick={() =>props.refreshWeathers("weatherMain.temp", props.weathers) }>{"temperature"}</th>
       <th onClick={() =>props.refreshWeathers("weatherMain.temp_max", props.weathers) }>{"maximum temperature"}</th>
       <th onClick={() =>props.refreshWeathers("weatherMain.temp_min", props.weathers) }>{"minimal temperature"}</th>
       <th onClick={() =>props.refreshWeathers("weather.description", props.weathers) }>{"description"}</th>                                
   </tr>
</thead>)

}
const changeLanguage = (language, i18n) => {
    i18n.changeLanguage(language);
};
export default withTranslation()(headerComponent)
